#
# Structure for table "pt_resources"
#

DROP TABLE IF EXISTS `pt_resources`;
CREATE TABLE `pt_resources` (
  `ids` varchar(32) NOT NULL,
  `version` bigint(20) DEFAULT NULL COMMENT '版本号',
  `osname` varchar(200) DEFAULT NULL COMMENT '操作系统名称',
  `ips` varchar(50) DEFAULT NULL COMMENT '本机IP',
  `hostname` varchar(200) DEFAULT NULL COMMENT '本机名称',
  `cpunumber` bigint(20) DEFAULT NULL COMMENT 'CPU数量',
  `cpuratio` decimal(20,5) DEFAULT NULL COMMENT 'CPU使用率',
  `phymemory` bigint(20) DEFAULT NULL COMMENT '物理内存总量',
  `phyfreememory` bigint(20) DEFAULT NULL COMMENT '物理内存-剩余可用',
  `jvmtotalmemory` bigint(20) DEFAULT NULL COMMENT '虚拟机-内存总量',
  `jvmfreememory` bigint(20) DEFAULT NULL COMMENT '虚拟机-空闲内存',
  `jvmmaxmemory` bigint(20) DEFAULT NULL COMMENT '虚拟机-最大内存量',
  `gccount` bigint(20) DEFAULT NULL COMMENT 'GC-垃圾回收次数',
  `createdate` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`ids`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='资源负载';

