DROP TABLE IF EXISTS `pt_user`;
CREATE TABLE `pt_user` (
  `ids` varchar(32) NOT NULL,
  `version` bigint(20) DEFAULT NULL,
  `errorcount` bigint(20) DEFAULT NULL,
  `orderids` bigint(20) DEFAULT NULL,
  `username` varchar(50) DEFAULT NULL COMMENT '登录账户',
  `password` varchar(200) DEFAULT '' COMMENT '密码',
  `hasher` varchar(200) DEFAULT NULL COMMENT '检查验证',
  `salt` varchar(200) DEFAULT '' COMMENT '加密盐',
  `email` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `mobilephone` varchar(18) DEFAULT NULL COMMENT '手机号码',
  `telephone` varchar(20) DEFAULT NULL COMMENT '固话',
  `status` char(1) DEFAULT NULL COMMENT '状态',
  `stopdate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '禁用时间',
  `userinfoids` varchar(32) DEFAULT NULL COMMENT '用户信息id',
  `stationids` text COMMENT '岗位id',
  `deptids` text COMMENT '部门id',
  `providerids` text COMMENT '提供者id',
  `groupids` text COMMENT '分组id',
  `stationnames` varchar(255) DEFAULT '' COMMENT '岗位名称',
  `deptnames` varchar(255) DEFAULT '' COMMENT '部门名称',
  `providername` varchar(255) DEFAULT '' COMMENT '提供者名称',
  `groupnames` varchar(255) DEFAULT '' COMMENT '分组名称',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`ids`),
  KEY `usernameindex` (`username`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='用户';

